import React, { useState, useEffect } from 'react';
// import axios from 'axios';

export const RoutesList = () => {
	const [routes, setRoutes] = useState();

	useEffect(() => {
		axios
		.get("http://webservices.nextbus.com/service/publicXMLFeed?command=routeList&a=ttc")
		.then(({ data }) => {
			setRoutes(data)
		});
	});
}
